import React from 'react';
import Style from "../../assets/style/resume.css";

export default function Resume() {
  return (
    <div className='content'>
      <h2>Resume!</h2>
      <div className='card'>
        <p className='jobinfo'> Delta Force Pi, LLC</p>
        <p className='jobinfo'> Gladstone, Michigan</p>
        <p className='jobtime'>November 2020 - Present</p>
        <p> Site Supervisor of security</p>
        <p> My job is to manage a team of 20 people and client satifaction! </p>
      </div>
      <div className="card">
        <p className='jobinfo'>Thillens Cagistics</p>
        <p className='jobinfo'>Madison, Wi</p>
        <p className='jobtime'>August 2018 to September 2020</p>
        <p> Route Manager</p>
        <p> My job was to manage a team of two, make sure we delivered to every stop, and balance out large amounts of cash at the end of our day.</p>
      </div>
    </div>
  );
}
